    public static List<List<Integer>> threeSum(int[] nums) {//三数之和
        ArrayList<Integer> arr = new ArrayList<>();
        ArrayList<ArrayList<Integer>> ret = new ArrayList<>();
        if (nums == null || nums.length < 3) return (ArrayList) ret;
        Arrays.sort(nums);
        int left = 0;
        int right = 0;
        int head = 0;
        int currNum = 0;
        for (head = 0; head < nums.length - 2; head++) {//head到这里就行了
            left = head + 1;
            right = nums.length - 1;
            while (left > head && right > left) {
                currNum = nums[left] + nums[right] + nums[head];
                if (currNum > 0) right--;
                else if (currNum < 0) left++;
                else {//==0
                    arr.add(nums[head]);
                    arr.add(nums[left]);
                    arr.add(nums[right]);
                    if (!ret.contains(arr)) ret.add(arr);
                    arr = new ArrayList<Integer>();
                    right--;
                }
            }
        }
        return (ArrayList) ret;
    }

    public static int threeSumClosest(int[] nums, int target) {
        Arrays.sort(nums);
        int curr = 0;//index;
        int left = curr + 1;
        int right = nums.length - 1;
        int ret = nums[0] + nums[1] + nums[2];
        int tmp = 0;
        while (curr < nums.length - 2) {
            while (left != right) {
                tmp = nums[curr] + nums[left] + nums[right];
                if (tmp > target) right--;
                else if (tmp < target) left++;
                else return target;
                ret = Math.abs(target - tmp) > Math.abs(target - ret) ? ret : tmp;
            }
            curr++;
            left = curr + 1;
            right = nums.length - 1;
        }
        return ret;
    }

