    public static int mySqrt(int x) {
        if (x == 0) return 0;
        long left = 1;
        long right = x / 2 + 2;
        while (left != right) {
            if (left * right < x) left++;
            else if (left * right >= x) right--;
            if (left * left > x && (left - 1) * (left - 1) < x) return (int) left - 1;
        }
        return (int) left;
    }

    public static int deleteAndEarn(int[] nums) {//todo
        int[] bucket = new int[10];
        int[] dp = new int[nums.length];
        for (int i = 0; i < nums.length; i++) {//进行桶排序
            bucket[nums[i]]++;
        }
        dp[1] = bucket[1];
        for (int i = 2; i < dp.length; i++) {
            if (bucket[i] > dp[i - 1]) {// 偷这次比上次大
                dp[i] = bucket[i] * i;
            } else {//这次没上次多
                dp[i] = bucket[i - 1] * (i - 1) + dp[i - 1];
            }
        }
        return dp[dp.length - 1];
    }

    public static int coinChange(int[] coins, int amount) {
        if (amount == 0) return 0;
        if (coins == null) return -1;
        int[] dp = new int[amount + 1];
        Arrays.fill(dp, Integer.MAX_VALUE);
        dp[0] = 0;
        for (int i = 1; i < dp.length; i++) {
            for (int j = 0; j < coins.length; j++) {
                // 硬币要大于要凑的数量
                if (i - coins[j] >= 0 && dp[i - coins[j]] != Integer.MAX_VALUE) {
                    // i 要凑的硬币 conins[j] 当前硬币  i-coins[j] 要凑的硬币减去当前硬币，结果为现在需要的硬币
                    dp[i] = Math.min(dp[i - coins[j]] + 1, dp[i]);//加一，表示已经凑上了
                }
            }
        }
        return dp[dp.length - 1] == Integer.MAX_VALUE ? -1 : dp[dp.length - 1];
    }

    public static boolean lemonadeChange(int[] bills) {// 5 10 10
        // 5 10 20
        if (bills == null || bills.length == 0) return true;
        int[] haveMoney = new int[2];
        int index = 0;
        for (index = 0; index < bills.length; index++) {
            if (bills[index] == 5) {
                haveMoney[0]++;
            } else if (bills[index] == 10) {
                haveMoney[1]++;
                haveMoney[0]--;
                if (haveMoney[0] < 0) return false;
            } else {//20
                if (haveMoney[1] > 0 && haveMoney[0] > 0) {
                    haveMoney[1]--;
                    haveMoney[0]--;
                } else if (haveMoney[0] >= 3) {
                    haveMoney[0] -= 3;
                } else {
                    return false;
                }
            }
        }
        return true;
    }

    public static boolean checkPossibility(int[] nums) {//todo
        int canSet = 1;
        for (int i = 1; i < nums.length - 1; i++) {
            // 1 1 2
            // 1 2 1
            // 2 1 1
            // 2 2 1
            // 2 1 2
            // 1 2 2
            // 左小右大
            //1 2 3
            //左大右小
            //3 2 1
            if (nums[i] < nums[i - 1] && nums[i] > nums[i + 1]) {
                return false;
            } else if (nums[i] > nums[i - 1] && nums[i] < nums[i + 1]) {
                return false;
            }// 右小
            else if (nums[i] > nums[i + 1]) {
                nums[i + 1] = nums[i];
                canSet--;
            }
        }
        return canSet >= 0;
    }

