    public static boolean canJump(int[] nums) {
        boolean[] dp = new boolean[nums.length];
        dp[0] = true;
        for (int i = 1; i < dp.length; i++) {
            for (int j = 0; j < i; j++) {
                if (dp[j] && nums[j] + j >= i) {
                    dp[i] = true;
                }
            }
        }
        return dp[dp.length - 1];
    }

    public static int uniquePathsWithObstacles(int[][] obstacleGrid) {
        if (obstacleGrid[0][0] == 1) return 0;
        int[][] dp = new int[obstacleGrid.length][obstacleGrid[0].length];
        for (int i = 0; i < dp.length; i++) {
            for (int j = 0; j < dp[0].length; j++) {
                if (obstacleGrid[i][j] == 1) dp[i][j] = -1;
                else if (i == 0 || j == 0 && dp[i][j] != 1) {
                    if (obstacleGrid[i][j] == 1) {
                        dp[i][j] = -1;
                        continue;
                    }
                    if (j - 1 >= 0 && dp[i][j - 1] == -1 || i - 1 >= 0 && dp[i - 1][j] == -1) {
                        dp[i][j] = -1;
                        continue;
                    }
                    dp[i][j] = 1;
                } else {
                    if (dp[i][j] != -1)
                        dp[i][j] = (dp[i - 1][j] >= 0 && dp[i][j - 1] >= 0 ? dp[i - 1][j] + dp[i][j - 1] : dp[i - 1][j] < 0 ? dp[i][j - 1] : dp[i - 1][j]);
                }
            }
        }
        return dp[dp.length - 1][dp[0].length - 1] == -1 ? 0 : dp[dp.length - 1][dp[0].length - 1];
    }

    public static int[] xorQueries(int[] arr, int[][] queries) {
        ArrayList<Integer> ret = new ArrayList<>();
        int tmp = 0;
        for (int i = 0; i < queries.length; i++) {
            for (int j = queries[i][0]; j <= queries[i][1]; j++) {
                tmp ^= arr[j];
            }
            ret.add(tmp);
            tmp = 0;
        }
        int[] r = new int[ret.size()];
        for (int i = 0; i < r.length; i++) {
            r[i] = ret.get(i);
        }
        return r;
    }

