    public static int numDecodings(String s) {
        int n = s.length();
        int[] dp = new int[n + 1];
        dp[0] = 1;
        for (int i = 1; i <= n; ++i) {
            if (s.charAt(i - 1) != '0') {
                dp[i] += dp[i - 1];
            }
            if (i > 1 && s.charAt(i - 2) != '0' && ((s.charAt(i - 2) - '0') * 10 + (s.charAt(i - 1) - '0') <= 26)) {
                dp[i] += dp[i - 2];
            }
        }
        return dp[n];
    }

    public static String addStrings(String num_1, String num_2) {
        if (num_1 == null || num_1.length() == 0 || num_1.charAt(0) == '0') return num_2;
        if (num_2 == null || num_2.length() == 0 || num_2.charAt(0) == '0') return num_1;
        int toAdd = 0;
        int i = 0;
        char[] num1 = num_1.toCharArray();
        char[] num2 = num_2.toCharArray();
        ArrayList<Integer> ret = new ArrayList<>();
        char[] ints = new char[Math.max(num1.length, num2.length)];
        Arrays.fill(ints, '0');
        int index = Math.min(num1.length, num2.length) - 1;
        for (int j = ints.length - 1; j <= ints.length - 1 && index >= 0; j--, index--) {
            ints[j] = num1.length < num2.length ? num1[index] : num2[index];
        }
        if (num1.length >= num2.length) {//todo frtdgayshujioklp;
            num2 = ints;
        } else {
            num1 = ints;
        }
        for (i = Math.max(num1.length, num2.length) - 1; i >= 0; i--) {
            int tmp = num1[i] - 48 + num2[i] - 48;
            if (tmp + toAdd >= 10) {
                ret.add(0, (toAdd + tmp) % 10);
                toAdd = 0;
                toAdd++;//进位;
            } else {
                ret.add(0, tmp + toAdd);
                toAdd = 0;
            }
        }
        if (toAdd != 0) ret.add(0, toAdd);
        StringBuffer toRet = new StringBuffer();
        for (int j = 0; j < ret.size(); j++) {
            toRet.append(ret.get(j));
        }
        return toRet.toString();
    }

